import React from "react";
import Card from "./Card";
import sdata from "./Sdata";

const Netflix = () => {
  return (
    <Card
      key={sdata[1].id}
      name={sdata[1].name}
      imgsrc={sdata[1].imgsrc}
      title={sdata[1].title}
      link={sdata[1].link}
    />
  );
};
export default Netflix;
